import './App.css';
import Navbar from './components/Navbar';
import Hero from './components/Hero'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Hero/>
      <section className="container py-8">
        <h2 className="text-2xl text-left text-violet-900 font-bold">Store student grades in the cloud</h2>
      </section>
      <section className="container py-8">
        <h2 className="text-2xl text-left text-violet-900 font-bold">Use OCR to scan report cards</h2>
      </section>
    </div>
  );
}

export default App;
